import React from 'react'
import { useState } from 'react'
import { Container, Col, Row } from 'react-bootstrap'
import './Home.css'
import Button from 'react-bootstrap/Button'
import { ButtonResult } from './Component/ButtonResult'

function HomePage() {
  const BuildingButton = () => {
    const [showResults, setShowResults] = React.useState(false)
    const onClick = () => setShowResults(true)
    return (
      <div>
        <input type='submit' value='Building' onClick={onClick} />
        {showResults ? <ButtonResult param='building' /> : null}
      </div>
    )
  }

  const LandButton = () => {
    const [showResults, setShowResults] = React.useState(false)
    const onClick = () => setShowResults(true)
    return (
      <div>
        <input type='submit' value='Land' onClick={onClick} />
        {showResults ? <ButtonResult param='land' /> : null}
      </div>
    )
  }

  return (
    <Container className='PageStyle'>
      <Row>
        <Col>
          <h1>LAND AND BUILDING</h1>
          <h5>Find you best offer for you with our service</h5>
        </Col>
        <Col>
          <BuildingButton />
          <LandButton />
        </Col>
      </Row>
      <Row>
        <h1> Our benefites... ... ... ... ...</h1>
      </Row>
    </Container>
  )
}

export default HomePage
